import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input to be visible and enter 'team'
    await page.waitForSelector('#eventSearchInput');
    await page.fill('#eventSearchInput', 'team');

    // Take screenshot after entering search term
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_search_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_search_input.png'));

    // Click the search button
    await page.waitForSelector('.search-btn');
    await page.click('.search-btn');

    // Wait for search results to load
    await page.waitForLoadState('networkidle');

    // Take screenshot of the results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Extract meaningful data (e.g., number of results found)
    const resultsCount = await page.evaluate(() => {
      return document.querySelectorAll('.event-result').length; // Assuming '.event-result' is the class for each event found
    });

    return {
      success: true,
      action: "Searched for team-related events and captured results",
      extractedData: { resultsCount },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

